import { Mapbox } from "../Mapbox"
import { Popup } from "../../components/Popup"



const useStyles = makeStyles(() => ({
  chartDiv: {
    height: '25em'
  }
}))

export const UnclusteredStates = () => {

    const classes = useStyles()

